INSERT INTO `checks` VALUES (7,'Avvitare i bulloni','19',NULL,NULL),(8,'Chiudere gli sfiatatoi','A1','Close',0),(10,'Comunicare al personale dell\'edificio che deve essere condotto un test di allarme.','18','Notify building personnel that an alarm test is to be conducted.',0),(11,'Ispeziona le condizioni del pannello (connessioni, fusibili, diodi emettitori di luce (LED)','18','Inspect panel condition (connections, fuses, light-emitting diodes ( LED)',0),(12,'Pulire (rimuovere sporco e polvere) sulla superficie interna / esterna del pannello.                                                                    Pulire i circuiti stampati elettronici dei pannelli di controllo utilizzando un panno morbido, asciutto e privo di lanugine o una spazzola morbida collegata a una spazzatrice.','18','Clean (remove dirt and dust) on panel interior/exterior surface.  Clean the electronic printed circuits of the control panels using a soft, dry, lint-free cloth or a soft brush attached to a vacuum sweeper.',NULL),(13,'Ispezionare tutti i cavi elettrici per isolare terminali bruciati, incrinati e allentati.','18','Inspect all of the electrical wiring for cracked or burned insulation and loose terminals.  Replace wiring and tighten terminals as necessary.  ',NULL),(14,'  Ispezionare tutti i cavi elettrici per isolare terminali bruciati, incrinati e allentati. Sostituire i cavi e serrare i terminali se necessario.','18','Inspect all of the electrical wiring for cracked or burned insulation and loose terminals.  Replace wiring and tighten terminals as necessary.    ',NULL),(15,' Ispezionare i supporti del pannello di controllo, i rel, gli interruttori (anti- manomissione), i terminali, ecc. per l\'hardware allentato eseguire la regolazione / serraggio.','18','Inspect control panel supports, relays, (tamper) switches, terminals, etc., for loose hardware.  Perform adjustment/tightening.   ',NULL),(16,'  Ispezionare / verificare il corretto funzionamento e, se necessario, eseguire piccole riparazioni / sostituzioni sui moduli di controllo dell\'allarme. Controllare il led e sostituirlo se necessario.','18','Inspect/verify for correct operation, and if required, perform minor repairs/replacements on the alarm control modules.  Check indicating led and replace if required.     ',NULL),(17,'Effettuare un\'ispezione generale di tutte le valvole dell\'irrigatore, dei ganci delle tubazioni e delle bretelle per assicurarsi che siano intatte e fissate saldamente. Effettuare le regolazioni / serraggio secondo necessit.','20','Conduct general inspection of all sprinkler valves, piping hangers and risers to ensure they are intact a securely fastened. Perform adjustments/tightening as necessary.     ',0),(18,'Controllare se i tubi dell\'irrigatore non sono piegati o danneggiati','18','Check if the sprinkler-pipes are not bend or damage.      ',5),(19,'Controllare il corretto funzionamento di tutti i dispositivi elettrici. Eseguire riparazioni se necessario.','19','Check correct operation of all the electrical devices. Performs repairs as necessary.      ',5),(21,'prova','19','test',0),(22,',,,','19',',,,,',0),(23,',,,ggg','19','ggg',8),(24,'QQQQQQQQ','19','QQQQQQQQQ',8),(25,'Inspect piping for obstructions and proper support.','19','Ispezionare le tubazioni per verificare che non vi siano ostruzioni e supporto adeguato.',0),(26,'Inspect agent container for condition.','19','Ispezionare il contenitore dell\'agente per le condizioni',0),(27,'Verificare la pressione di stoccaggio del propellente.','19','Verify the storage pressure of the propellant.',0),(28,'Freno: Esaminare e regolare lo stantuffo del freno in modo che sia libero e che funzioni nella sua massima cors. La distanza tra le ganasce del freno e il tamburo deve essere mantenuta al minimo. Esaminare i contatti del freno per usura e regolarli o sostituirli. Pulire la puleggia del tamburo del freno. Evitare che il materiale incoerente si impigli tra il tamburo e le ganasce del freno.','19','Brake: Examine and adjust the brake plunger so that it is free and that it operates to the full extent of this travel . Clearance between the brake shoes and the drum shall be maintained at a minimum . Examine the brake contacts for wear and adjust or replace. Clean the brake drum pulley. Prevent any loose material from catching between the drum and break shoes.',0),(29,'Funzionamento della cabina ascensore. Indagare su eventuali malfunzionamenti che si sono verificati in relazione al funzionamento della cabina dal momento in cui ? stata eseguita l\'ultima manutenzione; Guidare la cabina ascensore per rilevare eventuali operazioni improprie degli sportelli della cabina, porte al piano, accelerazione, livellamento della precisione della fermata al piano e l\'azione dell\' apertura della cabina; verificare il corretto funzionamento del bordo retrattile della porta; controllare pulsanti di chiamata, led, lampade, fotocellule, allarme; effettuare piccole riparazioni e regolazioni, sostituire pulsanti rotti e lampade o tubi bruciati nel sistema di illuminazione della cabina. Controllare tutti i dispositivi di segnalazione e gli indicatori di controllo delle lanterne a padiglione udibili e visibili. Effettuare sostituzioni e / o regolazioni di piccole riparazioni;','19','Car operation. Investigate any malfunctions have occurred in connection with the operation of the car since the last maintenance was performed; Ride car to detect any improper operation of the car doors, hoist way doors, acceleration, leveling accuracy of floor stops and the action of machine break; verify proper operation of retractable door edge; check call buttons, led, lamps, photocells, alarm; make minor repairs and adjustment, replace broken buttons and burned out lamps or tubes in the car lighting system. Check all audible and visible hall lanterns signaling devices and control indicators. Make minor repairs replacements and/or adjustments;',0),(30,'Interblocchi porta: Tirare ciascuna porta dal lato del corridoio mentre la cabina  in corsa per verificare che le porte siano bloccate saldamente e che la cabina non si fermi a causa di un contatto del circuito interrotto della porta. Verificare il circuito di contatto della porta sul pannello di controllo per la messa a terra e resistenza ai corto circuiti utilizzando un ohmmetro. Effettuare un controllo visivo e tattile degli interblocchi delle porte per verificare che non vi siano parti allentate. Regolare, pulire o lucidare in modo da conferire un aspetto brillante, oppure sostituire componenti di interblocco porta per un corretto funzionamento. Verificare lo stato di conservazione delle porte esterne.','19','Door interlocks. Pull on each his way door from the corridor side while the car is running to verify that the doors are securely locked and that the car does not stop because of an interrupted  door contact circuit. Test the door contact circuit at the control panel for grounds and high resistance shorts using an ohmmeter. Make visual and touch examination of door interlocks to see that there are no loose parts. Adjust, clean or burnish so naps to present a bright shine appearance, or repiace door interlock components for proper operation. Check for conservation state of external doors.',0),(31,'Check the brush spring tension and replace all brush of the same size and grade. Clean carbon dust from the brush  holders and insulators. Wipe off the commutator but do sand paper. lf the carbon dust cannot be entirely removed  from the commutator  by wiping ,the undercut slots should be cleaned by using appropriate tools. Maintain the commutator in an oil free condition','19','Controllare la tensione della molla della spazzola e sostituire tutta la spazzola delle stesse dimensioni e grado. Pulire la polvere di carbone dai portaspazzole e dagli isolanti. Pulire il commutatore, ma fare la carta vetrata. Se la polvere di carbone non pu essere completamente rimossa dal commutatore strofinando, le fessure del sottosquadro devono essere pulite usando strumenti appropriati. Mantenere il commutatore in una condizione priva di olio.',0),(32,'Trazione e fasce di deviazione. Controllare l\'allineamento della trazione e deviare le pulegge e effettuare piccoli aggiustamenti; se si rileva che le fasce si toccano,  informare il KO di condizioni non sicure rilevate.','19','Traction and diverting sheaves. Check the alignment of traction and diverting sheaves and make minor adjustment; if butting of sheaves grooves is taking place notify the Contracting Officer of unsafe condition found.',0),(33,'Premistoppa per cilindro. Esaminare il premistoppa a tre cilindri per perdite eccessive e stringere quando la perdita pu essere corretta serrando il premistoppa','19','Cylinder packing gland . Examine three cylinder patching gland for excessive leakage and tighten packing when leakage can be corrected by tightening   the gland.',0),(34,'Pompa idraulica. Pulire la pompa e il motore. Controllare che i cuscinetti e il motore non presentino rumori eccessivi e rumori insoliti mentre il gruppo pompa  in funzione, effettuare piccole riparazioni per correggere perdite di olio. Controllare visivamente l\'integrit di tutte le parti sotto pressione. Stringere le connessioni allentate e fare piccole riparazioni.','19','Hydraulic pump. Wipe down the pump and motor. Check bearings and motor for excessive head and unusual noise while the pump unit is running, make minor repairs to correct oil leakage. Visually check the integrity of all parts under pressure. Tighten loose connections and make minor repair.',0),(35,'Argano/Montacarichi: Pulire il dispositivo di sollevamento, controllare per rumori eccessivi ed insoliti, mantenere il livello dell\'olio prescritto per la scatola degli ingranaggi: effettuare piccole riparazioni per correggere le discrepanze.','19','Hoisting machine. Wipe down the hoisting machine, check the machine for excessive head and unusual noise, maintain the prescribed oil level in the gear housing : make minor repairs to correct discrepancies.',0),(36,'Cavi elettrici: Controllare che gli impianti elettrici non presentino collegamenti allentati e cavi sfilacciati; Stringere i collegamenti allentati e coprire qualsiasi cablaggio nudo.','19','Electrical wiring: Check electrical systems for loose connection and frayed wiring; Tighten loose connections and cover any bare wiring.',0),(37,'Dispositivi di comunicazione bidirezionale. Verificare il corretto funzionamento dell\'intero sistema ed effettuare la regolazione, eventuali riparazioni / sostituzioni secondarie se necessario. Fornire documentazione scritta dei risultati','19','Twoway communication  devices. Test for proper operation the entire system and  make adjustment, minor repair/replacements if necessary. Provide written record of findings.',0),(38,'Servizio del vigile del fuoco. Controllare e testare il servizio di Vigile del fuoco Richiamo della fase l e un minimo di un\'operazione su un piano, effettuare una piccola riparazione / sostituzione se necessario.','19','Firefighter\'s  Service. Check and test Firefighter\'s service Phase l recall and a minimum of one floor operation, make minor repair /replacement  if necessary.',0),(39,'Lubrificazione: Tutte le parti dei macchinari e delle attrezzature devono essere lubrificate a intervalli regolari con lubrificanti raccomandati dal produttore. Evitare l\'uso di quantit eccessive di lubrificanti.','19','Lubrication . All parts of the machinery and equipment shall be lubricated at regular period intervals with lubricants of the grate recommended  by manufacturer. Avoid use of excessive amounts of lubricants.',0),(40,'Pulizia. Le vie di sollevamento, i pozzetti e le sale macchine devono essere mantenute pulite e prive di sporco, spazzatura, olio o grasso. Pulizia della cabina e dei sottopiani per il corretto scorrimento di porte / cancelli.','19','Cleaning. Hoist ways, pits and machine rooms shall be kept clean and free of dirt, rubbish, oil or grease . Clean car and landing sills for proper sliding of doors/gates.',0),(41,'Estintori. Ispezionare visivamente il livello e il funzionamento corretti dell\'agente estinguente. Fornire e installare l\'etichetta sugli estintori, firmare e registrare la data dell\'ispezione. Registrare / segnalare eventuali anomalie.','19','Fire Extinguishers. Visually inspect for proper extinguishing agent level and operation .Provide and install tag on fire extinguishers, sign and record  date of inspection . Record/ report any anomalies.',0),(42,'Registra le condizioni dell\'assemblaggio della cabina. (nessun danno, corrosione, nessuna perdita di integrit strutturale)','19','Record the condition of the Car Assembly (no damage, corrosion, no loss of structural integrity)',0),(43,'Registra le condizioni del pannello operativo della cabina.  Il pannello operativo / indicatore ha danni minimi e corrosione, completamente operativo o compromesso dal punto di vista operativo','19','Record the condition of the Car Operating Panel (COP).Operating Panel/Indicator has minimal damage and corrosion, fully operational, operationally impaired.',0),(44,'Registra le condizioni del Door Assembly. Le porte della cabina hanno danni o usura minimi, le porte sono operative ma potrebbero essere necessarie delle regolazioni, le porte sono compromesse dal punto di vista operativo','19','Record the condition of the Door Assembly. Car Doors have minimal damage or wear, doors are operational but may need adjustments, doors are operationally impaired.',0),(45,'Registrare le condizioni del controllo dell\'elevatore. I controlli funzionano correttamente, i controlli devono essere calibrati, i controlli sono danneggiati e / o non funzionano.','19','Record the condition of the Elevator Control. Controls function properly, Controls need calibrating, Controls are damaged and/or not operational',0),(46,'Il pozzetto del pistone idraulico presenta danni, deterioramento, assenza di crepe o perdite, completamente sicuro, ancora operativo o compromesso dal punto di vista operativo.','19','Record the condition of the Lifting Assembly/Machine. Hydraulic Piston Well has damage, deterioration, no cracks or leaks, fully secured,still operational or operationally impaired.',0),(47,'Registrare le condizioni dei Controlli (Montacarichi): i controlli funzionano correttamente, hanno bisogno di essere calibrati, sono danneggiati e / o non operativi.','19','Record the condition of the Controls (LIFT): Controls function properly, need calibrating, are damaged and/or not operational.',0),(48,'Registrare le condizioni del Drive Assembly (Montacarichi) Il motore funziona correttamente, senza eccessivi rumori / vibrazioni o surriscaldamento. Il motore presenta rumori / vibrazioni insoliti, ma ancora operativo, potrebbe richiedere una manutenzione e / o un funzionamento notevolmente compromesso','19','Record the condition of the Drive Assembly (LIFT)  Motor operates properly, free of excessive noise/vibration, or overheating. Motor exhibits unusual noise/vibration, but still operational, may require maintenance and/or operation is significantly impaired.',0),(49,'Registrare le condizioni della piattaforma (Montacarichi). Piattaforma con danni o deterioramento. La piattaforma potrebbe essere allentata o instabile\r\n','19','Record the condition of the Lift Frame (LIFT) Platform has damage or deterioration. Platform may be loose or unstable.',0),(50,'Valvole di controllo (senza guarnizione, serratura o supervisione elettrica): avvertire il personale dell\'edificio che deve essere collegato un test di allarme','19','Control Valves (without seal, lock , or electric supervision): Notify building personnel that an alarm test is to be connected.',0),(51,'Controllare tutte le valvole del sistema di irrigazione (le valvole di controllo gate / check / globe / OS & Y) per rilevare eventuali perdite di pressione normale e assicurarsi che siano facilmente accessibili e completamente aperte. Riparare se necessario.','19','Check all sprinkler system valve ( l.e Gate/check/globe/OS&Y control valves ) for leaks to determinate that normal pressure lis being maintained and to be sure that they are readily accessible and fully open. Repair if needed.',0),(52,'Verificare la posizione della valvola','19','Verify valve position.',0),(53,'Assistenza tecnica ed eseguire regolazioni e riparazioni per correggere il funzionamento dei relativi dispositivi elettrici di controllo.\r\n','19','Services and perform adjustments and repairs to correct the operation of the related electrical control devices.',0),(54,'Controllare il corretto funzionamento della camera di rallentamento e dei dispositivi del gong di allarme dell\'acqua. Riparare se necessario.','19','Check the retarding chamber and water alarm gong devices for correct functioning. Repair if required.',0),(55,'Ispezionare visivamente la valvola PI per verificare se l\'acqua  accesa o spenta e pulire le finestre degli indicatori. Girare la valvola PI di alcuni giri per vedere se l\'acqua  accesa. Effettua un controllo visivo del manometro dell\'aria, apri e chiudi l\'acqua per vedere se la pressione sul manometro dell\'aria o dell\'acqua  bassa.','19','Visually inspect PI ?? valve to see if water is on or off and clean indicator windows. Turn PI ?? valve a few turns to see if water is on. Make visual check of air gauge, open and close water to see if pressure on air or water gauge is ',0),(56,'Segnalare eventuali carenze per azioni correttive e compilare il rapporto di manutenzione (il rapporto deve indicare chiaramente tutti i dispositivi testati.','19','Report any deficiencies for corrective action and fill out maintenance  report ( the report shall clearly indicate all tested devices.',0),(57,'Comunicare al personale dell\'edificio che deve essere condotto un test di allarme.','19','Notify building personnel that an alarm test is to be conducted.',0),(58,'Ispeziona le condizioni del pannello (connessioni, fusibili, diodi emettitori di luce (LED)','19','Inspect panel condition (connections, fuses, light-emitting diodes ( LED).',0),(59,'Pulire (rimuovere sporco e polvere) sulla superficie interna / esterna del pannello.                                                                    Pulire i circuiti stampati elettronici dei pannelli di controllo utilizzando un panno morbido, asciutto e privo di lanugine o una spazzola morbida collegata a una spazzatrice.','19','Clean (remove dirt and dust) on panel interior/exterior surface.  Clean the electronic printed circuits of the control panels using a soft, dry, lint-free cloth or a soft brush attached to a vacuum sweeper.',0),(60,'Ispezionare tutti i cavi elettrici per isolare terminali bruciati, incrinati e allentati. Sostituire i cavi e serrare i terminali se necessario.\r\n','19','Inspect all of the electrical wiring for cracked or burned insulation and loose terminals.  Replace wiring and tighten terminals as necessary.',0),(61,'Ispezionare i supporti del pannello di controllo, i rel, gli interruttori (anti- manomissione), i terminali, ecc. per l\'hardware allentato eseguire la regolazione / serraggio','19','Inspect control panel supports, relays, (tamper) switches, terminals, etc., for loose hardware.  Perform adjustment/tightening',0),(62,'Ispezionare / verificare il corretto funzionamento e, se necessario, eseguire piccole riparazioni / sostituzioni sui moduli di controllo dell\'allarme. Controllare il led e sostituirlo se necessario.','19','Inspect/verify for correct operation, and if required, perform minor repairs/replacements on the alarm control modules.  Check indicating led and replace if required.',0),(63,'Segnalare eventuali carenze per azioni correttive e compilare il rapporto di manutenzione (il rapporto deve indicare chiaramente tutti i dispositivi testati).','19','Report any deficiencies for corrective action and fill out maintenance report (the report shall clearly indicate all tested devices).',0),(64,'Comunicare al personale dell\'edificio che deve essere condotto un test di allarme','19','Notify building personnel that an alarm test is to be conducted.',0),(65,'Effettuare un\'ispezione generale di tutte le valvole dell\'irrigatore, dei ganci delle tubazioni e delle bretelle per assicurarsi che siano intatte e fissate saldamente. Effettuare le regolazioni / serraggio secondo necessit.','19','Conduct general inspection of all sprinkler valves, piping hangers and risers to ensure they are intact a securely fastened. Perform adjustments/tightening as necessary.',0),(66,'Controllare se i tubi dell\'irrigatore non sono piegati o danneggiati','19','Check if the sprinkler-pipes are not bend or damage.',0),(67,'Controllare il corretto funzionamento di tutti i dispositivi elettrici. Eseguire riparazioni se necessario.','19','Check correct operation of all the electrical devices. Performs repairs as necessary.',0),(68,'Ispezionare visivamente la valvola PI per verificare che l\'acqua sia aperta o chiusa e pulire la finestra dell\'indicatore.','19','Visually inspect PI valve to see that water is on or off and clean the indicator window.',0),(69,'Ruotare di qualche giro la valvola PI per vedere che l\'acqua  aperta.','19','Turn PI valve a few turns to see that water is on',0),(70,'Effettuare un controllo visivo del misuratore d\'aria.','19','Make visual check of air gauge.',0),(71,'Controllare visivamente la valvola di allarme antincendio per vedere se  aperta o chiusa.','19','Make visual check of fire alarm valve to see if open or closed.',0),(72,'Effettuare un\'ispezione visiva dei manometri aria e acqua.','19','Make visual inspection of air and water pressure gauges.',0),(73,'Segnalare eventuali carenze per azioni correttive e compilare il rapporto di manutenzione (il rapporto deve indicare chiaramente tutti i dispositivi testati.','19','Report any deficiencies for corrective action and fill out maintenance report.( the report shall clearly indicate all tested devices.',0),(74,'Segnalare eventuali carenze per azioni correttive e compilare il rapporto di manutenzione (il rapporto deve indicare chiaramente tutti i dispositivi testati.','19','Report any deficiencies for corrective action and fill out maintenance report.( the report shall clearly indicate all tested devices.',0),(75,'Comunicare al personale dell\'edificio che deve essere condotto un test di allarme.','18','Notify building personnel that an alarm test is to be conducted.',7),(76,'RIDE','A1','RIDE',8),(77,'Comunicare al personale dell\'edificio che deve essere condotto un test di allarme.','18','Notify building personnel that an alarm test is to be conducted.',7),(78,'Inspect piping for obstructions and proper support.','19','Ispezionare le tubazioni per verificare che non vi siano ostruzioni e supporto adeguato.',7),(79,'Verificare la pressione di stoccaggio del propellente.','19','Verify the storage pressure of the propellant.',7),(80,'Controllare il corretto funzionamento di tutti i dispositivi elettrici. Eseguire riparazioni se necessario.','19','Check correct operation of all the electrical devices. Performs repairs as necessary.      ',7);
